import ReactDOM from "react-dom";
import "./index.css";

import Slot from "./components/Slot";



ReactDOM.render(
  <React.StrictMode>
    <Slot header={<h1>header</h1>}>
      <h1>这是一个默认插槽</h1>
    </Slot>
  </React.StrictMode>,

  document.getElementById("root")
);
